package testing;

import javafx.scene.canvas.Canvas;
import org.junit.jupiter.api.Test;
import sample.Board;
import sample.Rules;

/**
 * Created by Alex on 22.02.2017.
 */
public class testNextGeneration {

    Canvas canvas = new Canvas();
    Board testBrett = new Board(canvas);

    @Test
    public void testNextGeneration() {
        org.junit.jupiter.api.Assertions.assertEquals(testBrett.toString(), "");
        System.out.println("Test 1 passert - Tomt brett");
        testBrett.start();

        org.junit.jupiter.api.Assertions.assertEquals(testBrett.toString(), "");
        System.out.println("Test 2 passert - Default brett");

        testBrett.rules.nextGeneration();
        testBrett.boardGrid = testBrett.rules.getBoard();

        org.junit.jupiter.api.Assertions.assertEquals(testBrett.toString(), "");
        System.out.println("Test 3 passert - Første nextGeneration");

        testBrett.rules.nextGeneration();
        testBrett.boardGrid = testBrett.rules.getBoard();

        org.junit.jupiter.api.Assertions.assertEquals(testBrett.toString(), "");
        System.out.println("Test 4 passert - Andre nextGeneration");

    }
}
